import React from 'react';
import Navigation from "./components/Navigation";

function App() {
  const navLinks=[{title:'AboutTlyer', link: 'about.html'},{title:'Explore History Dynamic 3', link: 'resources.html'}];

  return (
    <Navigation name="Awhshvini" links={navLinks}></Navigation>
  );
}

export default App;
